import React from 'react';
import './OvenItem.css';
import Loader from "../reusableComponents/Loader";



const OvenItem=({data})=>{

    let ovenview=null;
    // let setupsArr=setupData.data;

    if(data!=null && data.length>0) {
        ovenview = <div className="oven-wrapper">
            <div className="oven-section1">
                <div>{data.State}</div>
                <div>{data.Name}</div>
                <div> {data.CurrentTemperature}</div>
            </div>
            <div className="oven-section2">
                Profile:  Goal:
            </div>
            <div className="oven-section3">
                <div>ready: </div>
                <div>available</div>
                <div>found</div>
                <div>NF</div>
                <div>NA</div>
            </div>
            <div className="oven-section4">
                analytics
            </div>
        </div>
    }


    return(
        <div>{ovenview!=null ? (
        {ovenview}

    ):(
            <Loader/>
    )
    }
        </div>
    )
}

export default OvenItem;
